:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  VWILLIAMS, Joseph Heathcote and BUCHANAN, Sarah Nidra (Ally)
  JWILLIAMS, Norah and SUNDERLAND, Richard
  WILLIAMS, Norah and SUNDERLAND, Richard (cont...)
  worked for him used to call him "The General". Richard was taught by a governess for a few years then went
  to Heretaunga School in Hastings and Wanganui Collegiate School. His parents' marriage broke up when he
  was 15% and he then rode down from Poverty Bay to Tomoana, Hastings, leading a packhorse with all his
  worldly possessions. In 1895 he started work for William Nelson, but under Mr Tane the farm manager. He
  finally left Nelson's employ as farm manager of "Hukanui" at Puketitiri in about 1910 and bought a half
  bush farm near Makakaho up the Waitotara River west of Wanganui. He then went into partnership (for Â£1,000
  and he did the work) at Pareroa, behind "Blackhead" station and at the end of the Long Range Road,
  Waipukurau. When he married in 1916 he was offered the job by the trustees of managing "Te Apiti" station,
  Otane.
  For the rest of his life Richard farmed hill country in Hawke's Bay. In 1925 he and Norah built
  "Undercliff" beside the Tuki Tuki River at Te Mata, Havelock North but continued to oversee "Te Apiti" and
  "Waipoapoa". Later he also oversaw "Pukeatua" near Dannevirke for his Norah's sister Maud (Bersch) until
  it was taken in 1945 for rehabilitation of returned servicemen.
  01> SUNDERLAND, Joseph Langdalem on 25.04.1953 to CROSSE, Joan Elizabeth
  (Joe)
  (Sem)
  b 01.05.1917 d 01.01.1979
  b 13.09.1923
  Joe b. at Havelock North and m. at Henley-on-Thames by Joan's father, Joan, d/o Ernest Courtenay Crosse
  and Joyce Leslie Elizabeth Williams. Joe and Joan are second cousins. Joe's ashes were scattered on the
  hills at "Te Apiti". Address: 211 Leo Street, Hastings.
  Joe managed "Te Apiti" station from 1946 until time of his death in 1979. Sem is presently in the
  Continuing Care Unite at Mary Doyle Lifecare Trust, Havelock North.
  01> SUNDERLAND, Diana Maud
  b 04.02.1956
  Diana b. at Hastings. Address: 4/1302 Caroline Road, Hastings.
  Diana trained as a Karitane nurse and is now completing a National Certificate in Care for the
  Elderly. She is working on night duty at Gracelands Care Centre.
  02> SUNDERLAND, Christopher Langdale
  b 06.04.1957
  Address: 211 Leo Street, Hastings.
  Christopher works for Container Packaging Ltd in Hastings.
  03> SUNDERLAND, Sarah Anne m on 13.05.1995 to MACKENZIE, David Charles
  b 14.06.1965
  b ** ** ****
  David, s/o Lloyd Seaforth Mackenzie. Address: 1012 Southland Road, Hastings.
  Sarah is a senior customer service officer with Vehicle Testing NZ Ltd.
  E
  Z
  04> SUNDERLAND, Elizabeth Jane
  b 16.03.1968
  Elizabeth b. at Hastings. She graduated BCA in Economics from Victoria University and then
  completed a degree in Physiotherapy. She is now studying at Sydney, Australia towards her Masters
  in Gerontology. She has been overseas for the past four years.
  02> SUNDERLAND, Thomas Marmaduke m on 16.06.1951 to COUPER, Mabel Joan Mary
  b 06.08.1920
  b 19.09.1927
  Thomas 6. at Havelock North and m, at St Luke's Church, Havelock North. Mabel, d/o Harry Lowes Couper
  (farmer) and Ruth Cox, b. at Marton. Address: 91 la Clive Street, Hastings.
  Thomas served in the RNZVR for four years during WW2. After completion of his training he commanded
  LCI(L)380, LCT1086 at the Normandy Landing and LCI(L)125 to Burma and landing at Rangoon. After the war
  he managed "Waipoapoa" Estate from 1946 to 1952 then farmed at Argyll East until he retired to Hastings
  in 1987. He is now an enthusiastic outdoor bowler at the Hastings Bowling Club.
